import React from "react";
import {Container, Portfolio,PortfolioUl,PortfolioText } from "./styled/portfolio-styled";
import Css from '../img/Css.jpg';
import Harbor from '../img/Harbor.jpg';
import Ipsum from '../img/Ipsum.jpg';
import MoonCach from '../img/Mooncach.jpg';
import Sms from '../img/Sms.jpg';
import "../components/styled/portfolio-styleddd.css"
export default function Portfoliomen(){
    return(
        <Portfolio>

        <Container>

            <PortfolioUl>
                <a href="https://cubecss3d.netlify.app"><img src={Css} alt="" className='PhotoPort' /></a>
                <PortfolioText><a href="https://cubecss3d.netlify.app">css анимация - Домашняя страница</a></PortfolioText>
            </PortfolioUl>
            <PortfolioUl>
                <a href="https://harbor-maket.netlify.app"><img src={Harbor} alt="" className='PhotoPort' /></a>
                {/* <PortfolioText><a href="https://harbor-maket.netlify.app">Приложение, которое делает готовность к чрезвычайным ситуациям простой и удобной. - Домашняя страница</a></PortfolioText> */}
            </PortfolioUl>
            <PortfolioUl>
                <a href="https://ipsum-maket.netlify.app"><img src={Ipsum} alt="" className='PhotoPort' /></a>
                {/* <PortfolioText><a href="https://ipsum-maket.netlify.app">Развивайте свой подписной бизнес- Домашняя страница</a></PortfolioText> */}
            </PortfolioUl>
            <PortfolioUl>
                <a href="https://mooncach-maket.netlify.app"><img src={MoonCach} alt="" className='PhotoPort' /></a>
                {/* <PortfolioText><a href="https://mooncach-maket.netlify.app">Минималистичный модульный шаблон Webflow. - Домашняя страница</a></PortfolioText> */}
            </PortfolioUl>
            <PortfolioUl>
                <a href="https://sms-tariflar.netlify.app"><img src={Sms} alt="" className='PhotoPort' /></a>
                {/* <PortfolioText><a href="https://sms-tariflar.netlify.app">SMS-сервис для вашего бизнеса - Домашняя страница</a></PortfolioText> */}
            </PortfolioUl>

        </Container>

    </Portfolio>
    )
}
